import React, { useEffect } from 'react'
import { Link, Outlet } from 'react-router-dom'

export default function Nav() {
    const token = localStorage.getItem("token");
    const logouthandler=()=>{
        localStorage.removeItem("token");

    }

   useEffect(()=>{

   })

    return (
        <>

            <div class="flex justify-between bg-slate-900 px-4 py-1 text-gray-100 text-xl">
                <div class="my-auto flex h-full font-extrabold">Logo</div>
                <nav class="my-auto flex h-full space-x-3 font-bold">
                    <Link to="/"
                        class="cursor-pointer rounded-xl px-4 outline-blue-300 hover:bg-yellow-300 hover:text-gray-800 hover:outline hover:outline-2 hover:duration-75">
                        Home</Link>
                    <Link to="/complain"
                        class="cursor-pointer rounded-xl px-4 outline-blue-300 hover:bg-yellow-300 hover:text-gray-800 hover:outline hover:outline-2 hover:duration-75">
                        Complain</Link>
                    <Link to="/history"
                        class="cursor-pointer rounded-xl px-4 outline-blue-300 hover:bg-yellow-300 hover:text-gray-800 hover:outline hover:outline-2 hover:duration-75">
                        History</Link>
                </nav>

                {
        token?(
                <>
                 <div class="flex space-x-2 font-bold">
                        <button onClick={logouthandler()} class="m-1 rounded-xl bg-gray-200 px-4 py-1 text-gray-800 outline-2 outline-blue-400">Logout</button>
                    </div>

                </>
                ):(
                <>

                    <div class="flex space-x-2 font-bold">
                        <Link to="/login" class="m-1 rounded-xl bg-gray-200 px-4 py-1 text-gray-800 outline-2 outline-blue-400">Login</Link>
                        <Link to="/signup" class="m-1 rounded-xl bg-blue-500 px-4 py-1 text-gray-200">Signu Up</Link>
                    </div>

                </>
                )

       }



            </div>
            <Outlet />
        </>

    )
}
